__NUXT_JSONP__("/page/3", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s){return {data:[{works:{contents:[{id:"networkwebshop-ui",createdAt:m,updatedAt:n,publishedAt:m,revisedAt:n,title:"ネットワークウェブショップ \u002F UI",category:[{id:"web",createdAt:c,updatedAt:c,publishedAt:c,revisedAt:c,name:"Web"}],release:d,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002Fa04b4e45aa774552b3799731ea550cb2\u002Fnetwork-menudesign_1.jpg",height:430,width:600},overview:"店舗用家具の専門店ネットワークウェブショップ様のナビゲーション部分のUIデザイン、実装をさせていただきました。\n\nPC向けのデザインの印象を残し、左カラムをドロワーメニューとして開閉出来るようにしました。一番重要なカートへのリンク、メニューボタン、ロゴをヘッダーにまとめ固定したレイアウトにし、ページの途中からでも自由に他ページへ飛べる形にしました。",textlink1:"http:\u002F\u002Fwww.networkwebshop.com\u002F"},{id:"kawaiit-select-shopcard",createdAt:e,updatedAt:"2022-01-08T12:25:01.858Z",publishedAt:e,revisedAt:e,title:"Kawaiit select \u002F SHOP CARD",category:[],release:d,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002Fb8a79e41de6f491ea3669df74669c802\u002Fkawaiit-shopcard_01.jpg",height:860,width:1200},overview:"オトナカワイイをコンセプトに 輸入商品、リメイク品、ハンドメイド品を集めているセレクトショップ Kawaiit select様のショップカードを制作させていただきました。\n\nロゴの丸い形を生かして、オトナかわいらしさを感じる「コンパクト」の形で二つ折りの型抜き印刷を行い、手元にずっと残してもらえるような印象的な形に仕上がりました。\n\n印刷用紙は中に文字を書き込むことを配慮して、表面がミラー\b紙\u002F裏面が上質紙のミラー上質紙を使用しました。"},{id:"nicodosai-7th-web",createdAt:o,updatedAt:p,publishedAt:o,revisedAt:p,title:"第7回東方ニコ童祭 \u002F WEB SITE",category:[],release:d,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F993e28ee065f42ab8436e8d9d4b42b9a\u002Fsatoshisano_1.jpg",height:a,width:b},overview:"去年に引き続き第7回東方ニコ童祭さんのウェブサイトを制作させていただきました。\n\nメインビジュアルは今年もNamazuさんにお願いをしてお祭り感を取り入れたビジュアルを描いていただきました。「付喪神」をテーマにお祭り感をプラスし、目を引く動きを取り入れたデザインに仕上がりました。\n\nスマホ・タブレットに対応したレスポンシブWebデザインで構築しました。",textlink1:"https:\u002F\u002Fnicodosai.com\u002F7th\u002F"},{id:"trentes-recruit",createdAt:f,updatedAt:"2022-01-08T12:25:13.269Z",publishedAt:f,revisedAt:f,title:"株式会社トロント・インダストリー \u002F RECRUIT SITE",category:[],release:"2014-11-30T15:00:00.000Z",thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002Fd8587c218bc84838a51f9b03191f072d\u002Ftrentes_1-1.jpg",height:a,width:b},overview:"株式会社トロント・インダストリー様のリクルートサイトを制作させていただきました。\n\n「IT」という言葉から受ける少し硬く感じるイメージを変えたいと思い、ITに興味がある女性にも興味を持ってもらえるような優しく親しみやすいデザインを考えました。\n\n目標に向かって進んでいくイメージを飛ぶモチーフに例え、暮らしの生活を支えるITインフラのイメージを伝えられる世界観を目指しました。",textlink1:"https:\u002F\u002Ftrentes.net\u002Frecruit\u002Findex.html"},{id:"kawaiit-select-logo",createdAt:g,updatedAt:"2022-01-08T12:25:17.922Z",publishedAt:g,revisedAt:g,title:"Kawaiit select \u002F LOGO DESIGN",category:[],release:"2014-10-31T15:00:00.000Z",thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F42c1c13be8694930ad868dbf311f329a\u002Fkawaiitlogo_1.jpg",height:a,width:b},overview:"オトナカワイイをコンセプトに 輸入商品、リメイク品、ハンドメイド品を集めているセレクトショップ Kawaiit select様のロゴを制作させていただきました。\n\nお店のコンセプト「オトナカワイイ」からオトナ-秘密-鍵(キー)を連想し、キーをモチーフにカワイイの中にオトナを感じさせるデザインを考えました。\n\nモデル写真・一部の商品撮影、ネットショップのオープン準備もお手伝いさせていただきました。"},{id:"studio-pm-web",createdAt:h,updatedAt:"2022-01-08T12:25:22.198Z",publishedAt:h,revisedAt:h,title:"STUDIO P&M \u002F WEB SITE",category:[],release:i,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F465750ea0daf4426b5e1c627cfef0468\u002Fstudiopm_1.jpg",height:a,width:b},overview:"曙橋駅から徒歩3分！！新しくオープンしたライブ配信&レンタルスタジオ STUDIO P&M様のウェブサイトを制作させていただきました。\n\n駅より徒歩3分の\b「好アクセス」をキーワードに都営新宿線の緑色を取り入れたデザインに仕上がりました。\n\n管理・運営・更新のしやすさを配慮して、WordPressで構築を行いました。"},{id:"asayakenoato-web2014",createdAt:j,updatedAt:"2022-01-08T12:50:17.517Z",publishedAt:j,revisedAt:j,title:"asayake no ato \u002F RENEWAL WEB SITE",category:[],release:i,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002Fb9bf9c9aba07420088b990bb3f1afa96\u002Fasayake_1-1.jpg",height:a,width:b},overview:"京都出身4Pロックバンドasayake no atoさんのウェブサイトを制作させていただきました。\n\n「情景・時間・透明感」をテーマに音の情景を切り取ったデザインに仕上がりました。プロフィールページ以外の写真も担当させていただきました。\n\nasayake no atoさんの音から受ける「情景」と「透明感」、ロゴのコピーで使用していた「Are in recollection and the future」から時間をキーワードにPCサイズではトップページで映像が流れる仕組みにしています。\n\nライブ情報の更新のしやすさを配慮して、WordPressを使用したレスポンシブWebデザインで構築しました。"},{id:"asayakenoato-logo",createdAt:k,updatedAt:"2022-01-08T12:50:21.221Z",publishedAt:k,revisedAt:k,title:"asayake no ato \u002F LOGO DESIGN",category:[],release:i,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F28d2ba67649d4c75bd6346321ae481b5\u002Fasayakelogo_1.jpg",height:a,width:b},overview:"京都出身4Pロックバンドasayake no atoさんのロゴを制作させていただきました。\n\n勢いを感じさせる斜体と細い線を組み合わせたオリジナルフォントを制作し、スタイリッシュさを表現しました。\n\nグッズ展開などを配慮してさまざまな用途によって使い分けて使用できる形にしました。"},{id:"kalpea-paivittain",createdAt:l,updatedAt:"2022-01-08T12:50:30.381Z",publishedAt:l,revisedAt:l,title:"kalpea päivittäin",category:[],release:q,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002Fed08bd2feb044b2a819201033485d657\u002Fkalpealogo_1.jpg",height:a,width:b},overview:"オリジナルテキスタイルブランドkalpea päivittäin(カルピア・パイビタイン)のウェブショップを立ち上げました。\n\n「感動のある日々」をコンセプトに淡い日々に寄り添うオリジナルテキスタイル作っていきます。"},{id:"saigonohitoha-shibuoke",createdAt:r,updatedAt:s,publishedAt:r,revisedAt:s,title:"サイゴノヒトハ \u002F 渋沢一葉with渋沢内閣オーケストラ",category:[],release:q,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F38a304526e7c4d32b3979e7d1012c1dd\u002Fshibuoke_b1-1-800x500.jpg",height:500,width:800},overview:"コモリタミノルさんプロデュースのバンド、渋沢一葉with渋沢内閣オーケストラさんのジャケットデザインを制作させていただきました。\n\nアートディレクションは渋沢一葉さんご本人がされています。ナチュラルな雰囲気のデザインに仕上がりました。"}],totalCount:66,offset:20,limit:10},page:"3",pager:[0,1,2,3,4,5,6]}],fetch:{},mutations:void 0}}(670,1080,"2022-01-09T02:17:01.218Z","2015-03-31T15:00:00.000Z","2022-01-08T12:12:30.045Z","2022-01-08T12:17:17.013Z","2022-01-08T12:19:13.753Z","2022-01-08T12:21:19.060Z","2014-09-30T15:00:00.000Z","2022-01-08T12:30:30.713Z","2022-01-08T12:32:10.410Z","2022-01-08T12:34:07.838Z","2022-01-08T12:10:09.858Z","2022-01-09T08:41:49.502Z","2022-01-08T12:14:10.218Z","2022-01-08T13:02:06.996Z","2014-07-31T15:00:00.000Z","2022-01-08T12:36:21.521Z","2022-01-09T00:45:34.479Z")));